__NUXT_JSONP__("/drugs/Irinotecan_Sucrosofate", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1361317-83-0",chebiId:b,chemicalFormula:b,definition:"A liposomal formulation of the semisynthetic camptothecin analogue irinotecan with potential antineoplastic activity. During the S phase of the cell cycle, irinotecan selectively stabilizes topoisomerase I-DNA covalent complexes, inhibiting religation of topoisomerase I-mediated single-strand DNA breaks and producing lethal double-strand DNA breaks when complexes are encountered by the DNA replication machinery. Liposome encapsulation of this agent promotes efficient drug delivery into the cytosol from the endosome compartment of the cell.",fdaUniiCode:"OL741S3N8B",identifier:"C82676",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C2843"],synonyms:["IRINOTECAN SUCROSOFATE","Irinotecan Liposome",c,"MM-398","Nanoliposomal Irinotecan","Nanoparticle Liposome Formulation of Irinotecan","Onivyde","PEP02","nal-IRI"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FIrinotecan_Sucrosofate",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Irinotecan_Sucrosofate","","Irinotecan Sucrosofate","2021-10-30T13:46:04.583Z")));